(22, 1, 1, '<p class=\"lead\">Meksyk zachwyca kolorow kultur i wyjtkowym w skali wiatowej dorobkiem cywilizacyjnym. Oficjalna nazwa pastwa to Meksykaskie Stany Zjednoczone. Meksyk jest 14. najwikszym pastwem na wiata, a 11 pod wzgldem najwikszej liczby ludnoci. <br /><br /> Tradycja oraz etniczno przeplata si tutaj z cigle rozwijajcymi si miastami, kt贸re ttni 偶yciem nocnym i maj wiele do zaoferowania. Podr贸偶 do Meksyku to nie tylko wypoczynek, ale tak偶e wspaniaa okazja do poznania kultury skrajnie odmiennej od polskiej. Dziki temu taka wycieczka mo偶e okaza si wyjtkow przygod, kt贸r pamita bdziemy przez lata.</p>', '<p>Wakacje w Meksyku</p>', 'wakacje-w-meksyku', '', '', '', 'Mexico Vacation', '', '', '', ''),
